webpackJsonp([0x5d7758722224],{7252:function(e,a){e.exports={data:{post:{html:'<p><a href="http://www.loiclemeur.com/english/2005/03/tonline_germany.html" title="Loic Le Meur Blog: T-Online Germany launches weblogs on TypePad !">Loic Le Meur: T-Online Germany launches weblogs on TypePad!</a> Now I know <a href="http://www.hebig.com/archives/002919.shtml">why</a> <a href="http://hebig.com/">Heiko\'s blog</a> has been so quiet lately.</p>\n<p>This is great news for weblogging in Germany, even for those of us who work for <a href="http://blogg.de/">the competition</a>. The Telekom may be an IT dinosaur, but T-Online is still the number one ISP in Germany (and in Europe). Blogs <a title="Cscout Trendday Nachlese [Lummaland - das Weblog]" href="http://lumma.de/eintrag.php?id=1402">still haven\'t reached critical mass</a>, blogs are starting to get some <a title="Boeings \'Blogger\': Mr. Anti-Airbus missioniert im Web - Wirtschaft - SPIEGEL ONLINE" href="http://www.spiegel.de/wirtschaft/0,1518,344735,00.html">media attention</a>, and a push from the magenta giant can\'t hurt. And maybe, since T-Online is a multi-national ISP, they can generate some trans-national multi-lingual European blogging magic...</p>\n<p>Naaa.... dinosaurs have small brains, they can\'t think that fast.</p>',fields:{title:"Even Dinosaurs Can Lay Eggs",date:"11 Mar 2005",url:"https://papascott.de/2005-03-11-even-dinosaurs-can-lay-eggs/"}}},pathContext:{slug:"/2005-03-11-even-dinosaurs-can-lay-eggs/",prev:{fields:{title:"First Level Support",date:"09 Mar 2005",slug:"/2005-03-09-first-level-support/"}},next:{fields:{title:"Enterprise: Family",date:"12 Mar 2005",slug:"/2005-03-12-enterprise-family/"}}}}}});
